import React,{useState} from 'react';
import {Container} from 'react-bootstrap';

const LandingPage = ()=>{

    const [title,setTitle] = useState("LandingPage");

    return (
        <div>
            <p>{title} </p>
            <Container>
                <Row>
                    <Col>
                    <p></p>
                    </Col>
                    </Row>

            </Container>
        </div>

    );
};

export default LandingPage;
